    setTitle(e.target.value)
  }

  const changeText = (e) => {
    setText(e.target.value)
  }


  return (
    <div>
      <input type="text" name="title" id="title" className="input" onChange={changeTitle} />
      <textarea name="text" id="text" className="input" onChange={changeText}></textarea>

      <div className="btn">Добавить</div>
    </div>
  )
}


